export default function Todo(props) {
    return (
        <li className="todo-container"> 
            <div className="todo-outer-circle" onClick={() => props.toggleTodoCompleted(props.id)}>
                <div className={props.completed ? "todo-circle-ticked" : "todo-inner-circle"}>
                </div>
            </div>
            <div style={{textDecoration: props.completed ? "line-through" : "none"}} className="todo-text">
                {props.name}
            </div>
            <button type="button" className="todo-delete" onClick={() => props.deleteTodo(props.id)}>   
            </button>
        </li>
    );
}
